	line-height: ${Atoms.font.lineHeight.body};
	margin-bottom: ${Atoms.spacing.large};
`;

export default function P({
	children,
	id,
}: {
	children: React.ReactNode;
	id?: string;
}) {
	return <Wrapper id={id}>{children}</Wrapper>;
}
